import React from 'react';
import { Tabs, Radio, Space } from 'antd';
const { TabPane } = Tabs;

export default function Profile(props) {
    return (
        <div style={{ height: 550, margin: "65px", padding: "30px", backgroundColor: 'white' }} >
            <Tabs tabPosition={"left"}>
                <TabPane tab={<span style={{ textTransform: 'uppercase' }} className='text-black font-semibold text-xl'>
                    Thông tin tài khoản
                </span>} key="1">
                    Content of Tab 1
                </TabPane>
                <TabPane tab="Tab 2" key="2">
                    Content of Tab 2
                </TabPane>

            </Tabs>
        </div>
    );
}
